import { useEffect, useRef, useState } from "react";
import { useDispatch } from "react-redux";
import { setResourcesPosition } from "../../../../../app/features/resourcesSlice";
import { Resources } from "../../../../../enums/resources";
import { motion } from "framer-motion";

export const ResourceCard = (props: { type?: number; count: number }) => {
  const { type = Resources.kitsu } = props;

  const balanceRef = useRef<HTMLDivElement>(null);
  const dispatch = useDispatch();

  const [animatedCount, setAnimatedCount] = useState<number>(props.count);

  const prevCountRef = useRef<number>(props.count);

  const updatePosition = () => {
    if (balanceRef.current) {
      const rect = balanceRef.current.getBoundingClientRect();
      dispatch(
        setResourcesPosition({
          type,
          position: {
            x: rect.left + rect.width / 2 - 100,
            y: rect.top + rect.height / 2 - 50,
          },
        })
      );
    }
  };

  useEffect(() => {
    updatePosition();
    window.addEventListener("resize", updatePosition);
    return () => window.removeEventListener("resize", updatePosition);
  }, [type]);

  // Анімація зміни числа
  useEffect(() => {
    const prevCount = prevCountRef.current;
    const newCount = props.count;

    const isIncreasing = newCount > prevCount;

    const animationDuration = 1000; // Тривалість анімації в мс
    const stepTime = 50; // Крок оновлення
    const totalSteps = animationDuration / stepTime;
    const stepChange = (newCount - prevCount) / totalSteps;

    let currentStep = 0;

    const interval = setInterval(() => {
      currentStep++;
      if (currentStep >= totalSteps) {
        setAnimatedCount(newCount);
        clearInterval(interval);
      } else {
        setAnimatedCount((prev: number) => prev + stepChange);
      }
    }, stepTime);

    // Оновлюємо prevCountRef після завершення анімації
    prevCountRef.current = newCount;

    return () => clearInterval(interval);
  }, [props.count]);

  function defineCountString(count: number) {
    if (Math.floor(count / 1000000) > 0) {
      return Math.round(count / 100000) / 10 + "M";
    } else if (Math.floor(count / 1000) > 0) {
      return Math.round(count / 100) / 10 + "K";
    } else {
      return count.toFixed(2);
    }
  }

  // Визначаємо, чи збільшився або зменшився `count`
  const isIncreasing = props.count > prevCountRef.current;

  // Встановлюємо анімацію масштабу залежно від збільшення або зменшення
  const scaleAnimation = isIncreasing
    ? [1, 1.2, 1] // Анімація збільшення
    : [1, 0.8, 1]; // Анімація зменшення

  return (
    <div
      className="flex-1 flex flex-row items-center justify-center"
      ref={balanceRef}
    >
      <div className="w-[32px] h-[32px] z-10 items-center flex justify-center">
        {type === Resources.stone ? (
          <StoneIco />
        ) : type === Resources.experience ? (
          <XPIco />
        ) : type === Resources.kitsu ? (
          <div className="w-6 h-6">
            <KitsuIco />
          </div>
        ) : (
          <DwellersIco />
        )}
      </div>
      {type === Resources.kitsu && (
        <div className="text-center text-white text-xl font-normal uppercase leading-none">
          {defineCountString(Number(animatedCount.toFixed(2)))}
        </div>
      )}
      {type !== Resources.kitsu && (
        <div className="flex-1 bg-[#312E2B] border-[1px] border-black rounded-[3px] px-[2px] h-24px my-1 text-white text-center text-stroke-small text-[16px]">
          <motion.div
            initial={{ scale: 1 }}
            animate={{ scale: scaleAnimation }} // Залежить від збільшення або зменшення
            transition={{ duration: 0.5, ease: "easeInOut" }} // Час анімації
          >
            {defineCountString(Number(animatedCount.toFixed(2)))}
          </motion.div>
        </div>
      )}
    </div>
  );
};

